import React from "react";
import { Menu, Grid } from "antd";
const SubMenu = Menu.SubMenu;
const MenuItemGroup = Menu.ItemGroup;
import { Images } from "./../../config/image";
const { useBreakpoint } = Grid;
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faTachometerAlt,
  faUsers,
  faPlug,
  faMoneyBillAlt,
} from "@fortawesome/free-solid-svg-icons";
const LeftMenu = () => {
  const { md } = useBreakpoint();
  return (
    <Menu mode={md ? "horizontal" : "inline"}>
      <Menu.Item
        key="mail"
        style={{ backgroundColor: "#007C7E", paddingLeft: "5px" }}
      >
        <FontAwesomeIcon icon={faTachometerAlt} color="white" size="1x" />
        <a
          href=""
          style={{
            color: "white",
            fontSize: "15px",
            fontFamily: "PT Sans, sans-serif",
          }}
        >
          Bảng Quản Trị
        </a>
      </Menu.Item>
      <Menu.Item
        key="price"
        style={{ backgroundColor: "#007C7E", paddingLeft: "5px" }}
      >
        <FontAwesomeIcon icon={faUsers} color="white" size="1x" />
        <a
          href=""
          style={{
            color: "white",
            fontSize: "15px",
            fontFamily: "PT Sans, sans-serif",
          }}
        >
          Khách Thuê
        </a>{" "}
      </Menu.Item>
      <Menu.Item
        key="price"
        style={{ backgroundColor: "#007C7E", paddingLeft: "5px" }}
      >
        <FontAwesomeIcon icon={faPlug} color="white" size="1x" />
        <a
          href=""
          style={{
            color: "white",
            fontSize: "15px",
            fontFamily: "PT Sans, sans-serif",
          }}
        >
          Cơ Sở Vật Chất
        </a>{" "}
      </Menu.Item>
      <SubMenu
        key="price"
        style={{ backgroundColor: "#007C7E", paddingLeft: "5px" }}
        title={
          <div>
            <FontAwesomeIcon icon={faMoneyBillAlt} color="white" size="1x" />
            <a
              href=""
              style={{
                color: "white",
                fontSize: "15px",
                fontFamily: "PT Sans, sans-serif",
              }}
            >
              Nguồn Thu - Chi
            </a>{" "}
          </div>
        }
      >
        <Menu.Item
          key="setting:1"
        >
          <FontAwesomeIcon icon={faMoneyBillAlt} color="grey" size="1x" />
          <div style={{ paddingLeft: "10px", color: "#007c7e",
            fontSize: "15px",
            fontFamily: "PT Sans, sans-serif", }}>Phiếu Thu</div>
        </Menu.Item>
        <Menu.Item
          key="setting:1"
          style={{
            color: "#007c7e",
            fontSize: "15px",
            fontFamily: "PT Sans, sans-serif",
          }}
        >
          <FontAwesomeIcon icon={faMoneyBillAlt} color="white" size="1x" />
          Phiếu Thu
        </Menu.Item>
      </SubMenu>
      {/* <SubMenu key="sub1" title={<span>Blogs</span>}> */}
      {/* <MenuItemGroup title="Item 1">
          <Menu.Item key="setting:1">Option 1</Menu.Item>
          <Menu.Item key="setting:2">Option 2</Menu.Item>
        </MenuItemGroup>
        <MenuItemGroup title="Item 2">
          <Menu.Item key="setting:3">Option 3</Menu.Item>
          <Menu.Item key="setting:4">Option 4</Menu.Item>
        </MenuItemGroup> */}
      {/* </SubMenu> */}
      {/* <Menu.Item key="mail">
        <a href="">Khuyến Mãi</a>
      </Menu.Item>
      <Menu.Item key="alipay">
        <a href="">Contact Us</a>
      </Menu.Item> */}
    </Menu>
  );
};

export default LeftMenu;
